"use strict";

var swiper = new Swiper('.banner-slider__container', {
  autoplay: {
    delay: 5000
  },
  loop: true,
  spaceBetween: 70,
  navigation: {
    nextEl: '.banner-slider__next',
    prevEl: '.banner-slider__prev'
  },
  pagination: {
    el: '.banner-slider__pagination'
  }
});

var sandwich = function sandwich() {
  var sandwichButton = document.querySelector('.sandwich__open-btn');
  var sandwichClose = document.querySelector('.sandwich__close-btn');
  var menu = document.querySelector('.sandwich__content');
  sandwichButton.addEventListener('click', function () {
    menu.classList.add('sandwich__content--opened');
  });
  sandwichClose.addEventListener('click', function () {
    menu.classList.remove('sandwich__content--opened');
  });
};

$('.filter-nav__item').click(function () {
  $(this).toggleClass('filter-nav__item--active');
});

var popupLink = function popupLink() {
  $('.show-on-success').hide();
  $('.js-popup-link').magnificPopup({
    showCloseBtn: false
  });
  $(document).on('click', '.popup__close', function () {
    $.magnificPopup.close();
  });
  $('.popup-form__send').click(function () {
    $('.hide-on-success').hide();
    $('.show-on-success').show();
  });
};

sandwich();
popupLink();
